import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Contact : React.FC = () => {
    return(
        <>
            <Navbar />
            <p className="mt-32 justify-center items-center flex">Contact</p>
            <div className="mt-64">
                <Footer />
            </div>
        </>
    );
}

export default Contact;
